	<script>
		let allProperties, properties = [], propertiesIds = [], values = [], propsValues = [], chosenProperties = [], itemID="", lang = "en", type;

		function createHTML(){
			if(itemID!=""){//single item app
				var code = ''
				code += '&lt;div mv-app="main" mv-source="shapir" mv-source-service="wikidata" mv-source-id="'+itemID+'" mv-source-language="'+lang+'">'
				code += '&#10;'

				for(var p=0; p<chosenProperties.length; ++p){
					if(chosenProperties[p].type == "notObject"){
						code += '&nbsp;&nbsp;&lt;p property="'+chosenProperties[p].property+'">&lt;/p>'
						code += '&#10;'
					}else{
						code += '&nbsp;&nbsp;&lt;div property="'+chosenProperties[p].property+'">'
						code += '&#10;'
						code += '&nbsp;&nbsp;&nbsp;&nbsp;&lt;p property="label">&lt;/p>'
						code += '&#10;'
						code += '&nbsp;&nbsp;&nbsp;&nbsp;&lt;!-- you can add other '+chosenProperties[p].property+' properties -->'
						code += '&#10;'
						code += '&nbsp;&nbsp;&lt;/div>'
						code += '&#10;'
					}
				}

				code += '&lt;/div>'

				document.getElementById("singleItemCode").innerHTML = code;
				Prism.highlightElement($('#singleItemCode')[0]);

			}else{//list of items app

				var code = '' //new line in HTML
				code += '&lt;div mv-app="main" mv-source="shapir" mv-source-service="wikidata" mv-source-language="'+lang+'" '
				for(var p=0; p<propsValues.length; ++p){
					code += 'mv-source-'+propsValues[p].label;
					code += '= '+propsValues[p].value;
					code += '&nbsp;'

					if(p+1==propsValues.length){
						code += '>'
						code += '&#10;'

						for(var p=0; p<chosenProperties.length; ++p){
							if(chosenProperties[p].type == "notObject"){
								code += '&nbsp;&nbsp;&lt;p property="'+chosenProperties[p].property+'">&lt;/p>'
								code += '&#10;'
							}else{
								code += '&nbsp;&nbsp;&lt;div property="'+chosenProperties[p].property+'">'
								code += '&#10;'
								code += '&nbsp;&nbsp;&nbsp;&nbsp;&lt;p property="label">&lt;/p>'
								code += '&#10;'
								code += '&nbsp;&nbsp;&nbsp;&nbsp;&lt;!-- you can add other '+chosenProperties[p].property+' properties -->'
								code += '&#10;'
								code += '&nbsp;&nbsp;&lt;/div>'
								code += '&#10;'
							}
						}

						code += '&lt;/div>'

						document.getElementById("singleItemCode").innerHTML = code;
						Prism.highlightElement($('#singleItemCode')[0]);
					}
				}

			}
		}


		function buildApp(){

			if($('#language').val()){
				lang = $('#idQ').val();
			}

			if($('#idQ').val()){ //specific item
				itemID = $('#idQ').val();
				buildAppSingleItem(itemID, lang)
			}else{//list of items
				getPropertiesValues();
				buildAppListItem(propsValues)
			}
		}

		function buildAppSingleItem(id, lang){
			import('./wikidata.js')
				.then((module) => {
					module.wikidata(id, lang).then(data=>{
						console.log(data)
						getPropertiesFromObj(data);

					})//wikidata
				});
		}

		function buildAppListItem(props){
			import('./wikidata.js')
				.then((module) => {
					module.queryWikidata(propsValues).then(data=>{
						// console.log(data)
						getPropertiesFromObj(data[0])
					})
				});

		}

		function getPropertiesFromObj(data){
			for (const [key, value] of Object.entries(data)) {
				if(typeof value === 'object'  && !Array.isArray(value) && value !== null){
					type = "object"
				}else{
					type = "notObject"
				}
				$("#options").append('<div id="option-'+key+'"><input type="checkbox" id="'+key+'" name="'+key+'_'+type+'" value="'+value+'" class="option">&nbsp;<label for="'+key+'">'+key+'</label></div>');
			}

			$('#options').show();

			$('#options').before(
				'</br><input id="search" type="text" style="font-size: 1.3em;  width:200px; display: inline;"class="form-control" placeholder="search properties"/>'
				+'&nbsp;<span><a href="" onclick="return false;" id="search-clear">X</a></span>'
			);

			$('#search').keyup(function(){
				var valThis = $(this).val().toLowerCase();
				$('input[type=checkbox]').each(function(){
					var text = $('label[for="'+$(this).attr('id')+'"]').text().toLowerCase();
					(text.indexOf(valThis) == 0) ? $(this).parent().show() : $(this).parent().hide();
				});
			});

			// Search clear button
			$("#search-clear").click(function(){
				$("#search").val("");
				$('input[type=checkbox]').each(function(){
					$(this).parent().show();
				});
			});

			//Chosen properties
			$(".option").change(function(){
				chosenProperties = new Array(); //clear array
				$(".option").each(function(){
					if( $(this).is(':checked')){
						chosenProperties.push({
							property: $(this).attr("name").split("_")[0],
							type: $(this).attr("name").split("_")[1],
							value: $(this).val()
						});
					}
				});
				// console.log(chosenProperties)
			});
		}

		function getPropertiesValues() {
			//get property name
			$('input[type="text"].property').each(function () {
				properties.push($(this).val())
			});
			//get property value
			$('input[type="text"].value').each(function () {
				values.push($(this).val())
			});

			for (var i = 0; i < properties.length; ++i) {
				let firstWord = true;
				let modifiedLabel = properties[i].replace(/(\w+)(?:\s+|$)/g, function (_, word) {
					if (firstWord) {
						firstWord = false;
						return word;
					} else {
						return word.charAt(0).toUpperCase() + word.substr(1);
					}
				});

				propsValues.push({
					id: propertiesIds[i],
					label: modifiedLabel,
					value: values[i]
				})
			}

			// if($('#language').val()){
			// 	propsValues.push({
			// 		att: "language",
			// 		value: $('#idQ').val()
			// 	})
			// }

			// if($('#numResults').val()){
			// 	propsValues.push({
			// 		att: "numberOfItems",
			// 		value: $('#numResults').val()
			// 	})
			// }
			// else{
			// 	propsValues.push({
			// 		att: "numberOfItems",
			// 		value: "10"
			// 	})
			// }


			console.log(propsValues);

		function addPropertyRow() {
